INSERT INTO editii VALUES(9,7,'revista',NULL,'',1998,5,'','','',NULL,NULL,NULL,'',replace('(Comentariu forum la nr. 101): Numerotarea nu include numărul din mai ''98, care nu a apărut. Aceasta este și numerotarea oficială, după cum puteți vedea în numerele imediat următoare. Opt ani mai târziu, niște redactori puși pe șotii au scris pe coperta numărului 100 cum că ar fi numărul 101, Marius Ghinea dând următoarea motivație pe forum:\n\n"Ce scuze? Ce explicatii? Nu e nici o greseala, noi am facut-o anume...\nCe stiti voi despre acel numar care a existat, dar nu a aparut?\nNimic.\nVa ramine un mister, ceva despre care se va vorbi peste generatii ca despre Sfintul Graal.\nRepet pentru buna fixare in memoria afectiva a celor care ne iubesc, ne urasc, sau sint indiferenti relativ la noi. Adica a tuturor. Acel numar "lipsa" a existat, dar nu a aparut.\n101 este corect, dar intr-o cheie oculta, numai pentru cei care stiu, au vazut, au mirosit si chiar au pus mina la scrierea Numarului Fantoma din Level.\nEste "1" din "101" cel care sporeste taina celor ce sint Level...\nCinste celui care a vazut CĂ nu e, si nemurire glorioasa celor putini care au făcut CE nu e!"\n\nhttp://forum.level.ro/showthread.php?134853-Level-a-ajuns-defapt-la-numarul-100-nu-la-101&p=2837482&viewfull=1#post2837482\n\nEu nu-l cred până nu văd numărul respectiv. :p','\n',char(10)),'',NULL,'','');
